        <div>
            <ListGroup>
                <ListGroup.Item>javaScript</ListGroup.Item>
                <ListGroup.Item>HTML</ListGroup.Item>
                <ListGroup.Item>CSS</ListGroup.Item>
                <ListGroup.Item>React</ListGroup.Item>
                <ListGroup.Item>Mongo</ListGroup.Item>
            </ListGroup>
        </div>
    )

}

export default Lang;
